// The OpenType tag condition code is based on data and code from lang-ietf-opentype
// https://github.com/jclark/lang-ietf-opentype
enum OpenTypeTagCondition : uint32_t {
  OPENTYPE_CONDITION_FLAG_DEFAULT = 0,
  OPENTYPE_CONDITION_FLAG_ARY     = 1,
  OPENTYPE_CONDITION_FLAG_GEOK    = 2,
  OPENTYPE_CONDITION_FLAG_HANS    = 4,
  OPENTYPE_CONDITION_FLAG_HANT    = 8,
  OPENTYPE_CONDITION_FLAG_HK      = 16,
  OPENTYPE_CONDITION_FLAG_LATG    = 32,
  OPENTYPE_CONDITION_FLAG_LATN    = 64,
  OPENTYPE_CONDITION_FLAG_MO      = 128,
  OPENTYPE_CONDITION_FLAG_MONG    = 256,
  OPENTYPE_CONDITION_FLAG_POLYTON = 512,
  OPENTYPE_CONDITION_FLAG_SYRC    = 1024,
  OPENTYPE_CONDITION_FLAG_TW      = 2048,
};

static
uint32_t GetOpenTypeTagConditionFlag(const char *subtag, ssize_t length) {
  // this could be made a bit faster (especially when length is 4), but probably not worth it
  switch (length) {
    case 2:
      if (AreStringEqualCaseInsensitive(subtag, "hk", 2)) {
        return OPENTYPE_CONDITION_FLAG_HK;
      }
      else if (AreStringEqualCaseInsensitive(subtag, "mo", 2)) {
        return OPENTYPE_CONDITION_FLAG_MO;
      }
      else if (AreStringEqualCaseInsensitive(subtag, "tw", 2)) {
        return OPENTYPE_CONDITION_FLAG_TW;
      }
      break;
    case 3:
      if (AreStringEqualCaseInsensitive(subtag, "ary", 3)) {
        return OPENTYPE_CONDITION_FLAG_ARY;
      }
      break;
    case 4:
      if (AreStringEqualCaseInsensitive(subtag, "Geok", 4)) {
        return OPENTYPE_CONDITION_FLAG_GEOK;
      }
      else if (AreStringEqualCaseInsensitive(subtag, "Hans", 4)) {
        return OPENTYPE_CONDITION_FLAG_HANS;
      }
      else if (AreStringEqualCaseInsensitive(subtag, "Hant", 4)) {
        return OPENTYPE_CONDITION_FLAG_HANT;
      }
      else if (AreStringEqualCaseInsensitive(subtag, "Latg", 4)) {
        return OPENTYPE_CONDITION_FLAG_LATG;
      }
      else if (AreStringEqualCaseInsensitive(subtag, "Latn", 4)) {
        return OPENTYPE_CONDITION_FLAG_LATN;
      }
      else if (AreStringEqualCaseInsensitive(subtag, "Mong", 4)) {
        return OPENTYPE_CONDITION_FLAG_MONG;
      }
      else if (AreStringEqualCaseInsensitive(subtag, "Syrc", 4)) {
        return OPENTYPE_CONDITION_FLAG_SYRC;
      }
      break;
    case 7:
      if (AreStringEqualCaseInsensitive(subtag, "polyton", 7)) {
        return OPENTYPE_CONDITION_FLAG_POLYTON;
      }
      break;
  }
  return 0;
}

